import React from "react";
import { Row, Col, Input } from "antd";
const { Search } = Input;
const AddWork = () => {
  return (
    <Row style={{ margin: "30px 0px" }}>
      <Col span={12} offset={6}>
        <Search
          placeholder="name of work"
          allowClear
          enterButton="Add"
          size="large"
        />
      </Col>
    </Row>
  );
};
export default React.memo(AddWork);
